properties.description:
Via Giuseppe Colombo, nel cuore della zona di Città Studi, in un silenzioso viale alberato, villa unifamiliare del 1930 cui gode di una doppia esposizione est-ovest, ad est l’ingresso sulla via G. Colombo ed ad ovest il giardino privato interno.
L’abitazione è così composta: al piano terra/rialzato ingresso, soggiorno, cucina open-space con comodo accesso alla terrazza che si affaccia sul giardino sottostante, lavanderia; al piano inferiore area spa con bagno turco e doccia, bagno, vano tecnico, ripostiglio, zona living attrezzata con home-theatre, accesso al giardino con patio e zona barbecue; al piano primo due comode camere da letto con bagno dedicato, disimpegno e ripostiglio; 
